function client_ID(e,t){const i=import("https://openfpcdn.io/fingerprintjs/v3").then(e=>e.load());i.then(e=>e.get()).then(i=>{const n=i.visitorId;var s=new XMLHttpRequest,o=e+"/"+n;s.open("GET",o,!0),s.setRequestHeader("X-Requested-With","XMLHttpRequest"),s.setRequestHeader("Ajax-Request-Token",t),s.send()})}function LimitFilesize(e,t){e.files[0].size>t&&(alert("invalid file size"),e.value="")}